-- ----------------------------
-- Table structure for `opb_business`
-- ----------------------------
DROP TABLE IF EXISTS `opb_business`;
CREATE TABLE `opb_business` (
  `business_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '加盟商ID',
  `name` varchar(200) NOT NULL DEFAULT '' COMMENT '加盟商名称',
  `pid` int(11) NOT NULL DEFAULT '0' COMMENT '上级商户id 0表示顶级商户,用于平台/合伙人; -1表示没有父级商户,用于企业用户',
  `sysid` tinyint(1) NOT NULL DEFAULT '5' COMMENT 'system.sysid',
  `business_intime` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `business_uptime` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `status` tinyint(4) DEFAULT '1' COMMENT '店铺状态 1正常 2屏蔽',
  `business_account` varchar(255) DEFAULT '' COMMENT '店铺账号',
  `business_logo` varchar(256) DEFAULT '' COMMENT '商户logo',
  `business_broker` int(11) DEFAULT '0' COMMENT '佣金比例',
  `business_check_reason` varchar(255) DEFAULT '' COMMENT '审核状态修改备注',
  `business_goods_need_check` tinyint(4) DEFAULT '0' COMMENT '店铺商品是否需要审核,0系统默认，1必须审核，2无需审核,3仅上架第一次时需审核',
  `business_allow_login` tinyint(4) DEFAULT '1' COMMENT '是否允许登录卖家中心，1允许，2不允许',
  `business_allow_goods_show` tinyint(4) DEFAULT '1' COMMENT '店铺商品是否在商城展示，1允许，2不允许',
  `business_allow_show` tinyint(4) DEFAULT '1' COMMENT '店铺是否在商城展示，1允许，2不允许',
  `business_sort` int(11) DEFAULT '50' COMMENT '排序',
  `business_starttime` int(11) DEFAULT '0' COMMENT '开店时间',
  `business_endtime` int(11) DEFAULT '0' COMMENT '店铺结束时间',
  `business_is_recommend` tinyint(4) DEFAULT '0' COMMENT '0不推荐，1推荐',
  `business_check_status` tinyint(4) DEFAULT '0' COMMENT '0待审核，1审核通过，2审核不通过',
  `business_company_id` int(11) DEFAULT NULL COMMENT '商户企业id',
  PRIMARY KEY (`business_id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COMMENT='加盟商信息表';

