DROP TABLE IF EXISTS `opb_member`;
CREATE TABLE `opb_member` (
  `uid` int(11) NOT NULL AUTO_INCREMENT,
  `mobile` varchar(32) NOT NULL DEFAULT '' COMMENT '登录手机号',
  `account` varchar(32) NOT NULL DEFAULT '' COMMENT '登录账号',
  `email` varchar(128) NOT NULL DEFAULT '' COMMENT '邮箱地址',
  `business_id` int(11) NOT NULL DEFAULT '1' COMMENT 'business.business_id 运营商id',
  `truename` varchar(32) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `nickname` varchar(32) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `phone` varchar(32) NOT NULL DEFAULT '' COMMENT '座机号码',
  `pwd` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  `avatar` varchar(256) NOT NULL DEFAULT '' COMMENT '用户头像url',
  `login_ip` varchar(32) NOT NULL DEFAULT '' COMMENT '登录ip',
  `login_time` int(11) NOT NULL DEFAULT '0' COMMENT '登录时间',
  `pay_wallet_id` varchar(64) NOT NULL DEFAULT '' COMMENT '用户钱包id',
  `sex` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0女1男2保密',
  `birthday` int(11) NOT NULL DEFAULT '0' COMMENT '用户生日【转detail】',
  `reg_ip` varchar(32) NOT NULL DEFAULT '' COMMENT '注册IP地址【转detail】',
  `reg_date` int(11) NOT NULL DEFAULT '0' COMMENT '注册时间【转detail】',
  `province` int(11) NOT NULL DEFAULT '0' COMMENT '省份【转detail】',
  `city` int(11) NOT NULL DEFAULT '0' COMMENT '城市【转detail】',
  `area` int(11) NOT NULL DEFAULT '0' COMMENT '区、县【转detail】',
  `address` varchar(64) NOT NULL DEFAULT '' COMMENT '地址【转detail】',
  `postalcode` int(11) NOT NULL DEFAULT '0' COMMENT '邮政编码【转detail】',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `uni_member_mobile` (`mobile`),
  KEY `idx_member_account` (`account`),
  KEY `idx_member_email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=417 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='网站前台会员表';

