  `type` int(2) DEFAULT '0' COMMENT '0-普通消息，1-系统消息，2-富拍活动，3-订单消息',
  PRIMARY KEY (`mes_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

