-- ----------------------------
-- Table structure for `opb_node`
-- ----------------------------
DROP TABLE IF EXISTS `opb_node`;
CREATE TABLE `opb_node` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `pid` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '上级菜单id',
  `sysid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'system.sysid（所属系统）',
  `remarks` varchar(128) DEFAULT '' COMMENT '备注',
  `title` varchar(50) NOT NULL DEFAULT '' COMMENT '菜单标题',
  `icon` varchar(40) NOT NULL DEFAULT '' COMMENT 'icon',
  `url_value` varchar(255) NOT NULL DEFAULT '' COMMENT '链接地址（module/controller/action)',
  `is_menu` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0：非菜单项（弹窗-增删改），1：菜单项，2：非菜单项（新页面-增改）',
  `files` varchar(255) NOT NULL DEFAULT '' COMMENT '需要按需加载的文件',
  `query` varchar(255) NOT NULL DEFAULT '' COMMENT '查询参数',
  `sort` smallint(6) unsigned NOT NULL DEFAULT '50' COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`),
  KEY `idx_node_pid` (`pid`),
  KEY `idx_node_status` (`status`),
  KEY `idx_node_title` (`title`),
  KEY `idx_node_sort` (`sort`),
  KEY `idx_node_sysid` (`sysid`)
) ENGINE=InnoDB AUTO_INCREMENT=10014 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='后台节点表';

